import React, { Component } from "react";
import "./App.css";
import { DoctorLayout } from "./doctor_ui";
import { PatientLayout } from "./patient_ui";
import { AdminLayout } from "./admin_ui";
import { SignUp } from "./signup";
import { SignIn } from "./signin";
import { Home2 } from "./home2";
import { Route, BrowserRouter } from "react-router-dom";
import { VitalsTable2 } from "./components/vitalstable2";

// import { Test } from "./test";
// import { Test2 } from "./test2";
//import { TestTable } from "./components/testtable";
// import { AlertTable } from "./components/alerts";
// import { Extract } from "./components/extract";
// import { AdminExtract } from "./components/listextractor";
// import axios from "axios";
// import { PatTable } from "./components/pattable";
// import { PatTableTemp } from "./components/pattable";

class App extends Component {
  constructor() {
    super();
    this.state = {
      data: [],
      v: "sex",
    };
  }

  //set url here
  url = "http://c53b8891d2d7.ngrok.io/";
  render() {
    return (
      <div className="App">
        <BrowserRouter>
          <Route path="/" component={Home2} />
          <Route
            path={"/signin"}
            exact
            render={(props) => {
              return <SignIn {...props} url={this.url} />;
            }}
          />
          <Route
            path="/signup"
            exact
            render={(props) => {
              return <SignUp {...props} url={this.url} />;
            }}
          />
          <Route
            path="/doctor/:d_id"
            exact
            render={(props) => {
              return <DoctorLayout {...props} url={this.url} />;
            }}
          />
          <Route
            path="/patient/:p_id"
            exact
            render={(props) => {
              return <PatientLayout {...props} url={this.url} />;
            }}
          />
          <Route
            path="/admin/:a_id"
            exact
            render={(props) => {
              return <AdminLayout {...props} url={this.url} />;
            }}
          />
          <Route
            path="/vitals/:p_id"
            exact
            render={(props) => {
              return <VitalsTable2 {...props} url={this.url} />;
            }}
          />
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
